import{_ as e,c as t,o as a,a as s}from"./app.26a85adb.js";const _=JSON.parse('{"title":"What is the SEP API?","description":"","frontmatter":{},"headers":[],"relativePath":"reference/what-is-the-sep-api.md"}'),r={name:"reference/what-is-the-sep-api.md"},i=s('<h1 id="what-is-the-sep-api" tabindex="-1">What is the SEP API? <a class="header-anchor" href="#what-is-the-sep-api" aria-hidden="true">#</a></h1><p>The SEP API is an unofficial API for the <a href="https://plato.stanford.edu/" target="_blank" rel="noreferrer">Stanford Encyclopedia of Philosophy</a>. The official SEP website is scraped periodically, and access its entries&#39; contents is provided through a modern RESTful API.</p><p>The current (and temporary) base URL for the API is:</p><ul><li><a href="https://s-xhpd.onrender.com/api/v1/" target="_blank" rel="noreferrer">https://s-xhpd.onrender.com/api/v1/</a></li></ul><h1 id="known-issues-and-limitations" tabindex="-1">Known Issues and Limitations <a class="header-anchor" href="#known-issues-and-limitations" aria-hidden="true">#</a></h1><p>Currently, the SEP-API only goes back to the Fall of 2006 Edition in the archives. Older editions in the archives have a different HTML structure that the scraper still doesn&#39;t support.</p><p>Moreover, the current version of the SEP-API doesn&#39;t include the supplements for the entries.</p><h1 id="bugs-features-and-other-issues" tabindex="-1">Bugs, Features and Other Issues <a class="header-anchor" href="#bugs-features-and-other-issues" aria-hidden="true">#</a></h1><p>If you find a bug, want a feature, or encountered any issue with the SEP-API, feel free to open a ticket at <a href="https://github.com/writeonlycode/sep-api/issues" target="_blank" rel="noreferrer">https://github.com/writeonlycode/sep-api/issues</a>!</p>',9),n=[i];function o(h,d,p,c,l,u){return a(),t("div",null,n)}const P=e(r,[["render",o]]);export{_ as __pageData,P as default};
